var title_f41_55_42870="Endometrial polyps at hysteroscopy";
var content_f41_55_42870=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F51898&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F51898&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 552px\">",
"   <div class=\"ttl\">",
"    Hysteroscopic view of endometrial polyps",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 532px; height: 547px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) A large functional polyp covered with normal endometrium spread over the posterior wall of the uterine cavity. CO2 bubbles are seen above the polyp.",
"    <br>",
"     (B) An endometrial polyp with a thin pedicle tending to take the appearance of a nonfunctional lesion as it grows bigger.",
"     <br>",
"      (C) Polyp prolapsing through the internal cervical os.",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"       Reproduced with permission from: Baggish MS, Valle RF, Guedj H. Hysteroscopy: Visual Perspectives of Uterine Anatomy, Physiology and Pathology. Philadelphia: Lippincott Williams &amp; Wilkins, 2007. Copyright &copy; 2007 Lippincott Williams &amp; Wilkins.",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
