var title_f41_55_42871="Chromophore absorption spectrum";
var content_f41_55_42871=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F74419%7EDERM%2F60561&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F74419%7EDERM%2F60561&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 507px\">",
"   <div class=\"ttl\">",
"    Chromophore absorption spectrum",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 487px; height: 298px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The absorption spectra vary among chromophores. Absorption of light by melanin progressively decreases with increasing wavelengths of light. In contrast, the absorption of light by water molecules generally increases as wavelengths increase. Oxyhemoglobin has two peaks of light absorption within the visible light range.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 482px\">",
"   <div class=\"ttl\">",
"    Laser penetration into skin",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 462px; height: 493px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In the range of visible light and near infrared light (400 to 1200 nm), lasers that emit long wavelengths of light penetrate more deeply into the skin than lasers that emit shorter wavelengths of light.",
"    <br>",
"     Mid-infrared (eg, Er:YAG) and far-infrared (eg, CO",
"     <sub>",
"      2",
"     </sub>",
"     ) lasers do not follow this rule. Heavy absorption by water in the skin greatly limits the penetration of these lasers.",
"     <div class=\"footnotes\">",
"     </div>",
"     <div class=\"reference\">",
"     </div>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
