var title_f41_55_42875="Diagnostic laboratory evaluation for neutropenia";
var content_f41_55_42875=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F51687&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F51687&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Diagnostic laboratory evaluation for neutropenia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Test",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Serial blood counts",
"       </td>",
"       <td>",
"        Observation over time of the complete blood count is often the best approach.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sedimentation rate (ESR), C-reactive protein (CRP)",
"       </td>",
"       <td>",
"        Elevations of the ESR and/or CRP in the absence of any overt infection suggests underlying infection due to neutropenia or presence of autoimmune disease.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        ANA*, C3, C4, anti-DNA",
"       </td>",
"       <td>",
"        Screening tests for the presence of collagen vascular disease.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Methylmalonic acid, homocysteine, copper, ceruloplasmin, pyridoxine",
"       </td>",
"       <td>",
"        Indicate abnormality in micronutrients that can be associated with marrow failure. High methylmalonic acid and/or homocysteine suggest B12 or folate deficiency even if serum levels are normal. Low ceruloplasmin is associated with neutropenia or pancytopenia and corrects with copper replacement.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bone marrow aspirate and biopsy with cytogenetics",
"       </td>",
"       <td>",
"        Testing to address possibility of underlying hematologic malignancy, myelodysplastic syndrome, maturation arrest.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        CD3/CD16,56,57, immunoglobulins, tetanus titers",
"       </td>",
"       <td>",
"        Natural killer cells/cytotoxic T cell subsets. A clone of &gt;20 percent suggests large granular lymphocyte disease; immunodeficiency can present with neutropenia.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Genetic testing",
"       </td>",
"       <td>",
"        Specific gene tests are available for several of the congenital neutropenias.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * ANA would include both antineutrophil as well as antinuclear antibodies",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
